import { useState } from "react";

const Logout = ({ outModal }) => {
  const closeModal = () => {
    outModal(false);
  };
  return (
    <div className="modalBackground">
      <div className="modalContainer">
        <div className="title">
          <h1>Do you want to sign out ?</h1>
        </div>
        <div className="body">
          <button onClick={closeModal}>Sign out</button>
        </div>
      </div>
    </div>
  );
};

export default Logout;
